	.text
	LDR X6, =Array
	LDR X0, contenido_X0
    MRS X9, CPACR_EL1			// Read EL1 Architectural Feature Access Control Register
	MOVZ X10, 0x0030, lsl #16	        // Set BITs 20 and 21
	ORR X9, X9, X10
	MSR CPACR_EL1, X9			// Write EL1 Architectural Feature Access Control Register

	//Cargo el array z
	LDR X20, =Z
	
//CODE HERE

	// N
	ADD X7, X7, N
	

	// Alpha
	ADD X1, X1, alpha
	scvtf d19, X1

	ADD X2, X2, #3 //nuestro X
	ADD X3, X3, #2 // nuestro primer valor Y

	// Inicializamos el valor de i en cero
	SUB X22, X22, X22

daxpy_loop:
	add x15, x15, #8
    scvtf d15, x15                // 8

	//Calculo de X
	add x2, x2, #2
    scvtf d13, x2
    fdiv d13, d13, d15
    stur d13, [x2, #0]            

	//Calculo de Y
    add x3, x3, #10
    scvtf d14, x3
    fdiv d14, d14, d15
    stur d14, [x3, #0] 

	//Multiplicar alpha por X
    fmul d15, d15, d17

	//Sumar X*alpha + Y
    fadd d16, d16, d15

	//Multiplicar valor de i
	lsl X21, X22, #3

	// Almacenar en Z
	add X20, X20, X21
	stur d16, [X20]

	//incrementar valor de i
	ADD X22, X22, #1

	SUBS X7, X7, #1          // Decrementar N en 2
    BNE daxpy_loop            // Saltar a daxpy_loop si N no es igual a cero
//END CODE


end:
infloop: B infloop





